import React,{ useState } from 'react';
import { GlobalStyle } from './styles/GlobalStyle';

const Test = ({test}) => {
  if(test) {
    return (
      <h1>Triple cork!!!</h1>
    );
  } else {
    return (
      <h1>Double Half XD</h1>
    );
  }
}



const App = () => {
  const [count,setCount] = useState(true);
  return (
    <div>
      <GlobalStyle />
      <Test test={count}/>
      <button onClick = {() => setCount(!count)}>click this</button>
    </div>
  );
};



export default App;
